import { Link } from "react-router-dom";
import './workdetailspecific.css'

const Detailspecific = () => { 
    return ( 
        <div id="project-details" className='my-40 text-left'>
            <a href="/work.html" className='link text-2xl font-bold'><i className="bi bi-arrow-left mr-2"></i>BACK</a>
            <h1 className='text-6xl font-semibold mb-12'>ComputerPhile</h1>
            <p className='text-3xl mb-12'> While ChargedUp was one of the hottest London startups of 2019, their mobile apps were in dire need of attention.</p>
            <p className='text-3xl mb-12'>Alarm bells rang when their support team started receiving requests from customers who had trouble performing basic tasks within the apps.</p>
            
            <div className="p-12">
                <img src="/full-preview.jpg" alt="" className="my-28 mx-4" />
            </div>

            <a href=""><button type="button" className="btn btn-lg relative">Visit Website</button></a>  
    </div>
     );
}
 
export default Detailspecific;
